This message is for those who have the “standard” that their partner has to be able to cook or clean well in order to be a good wife/mother (which is a skill all adults should have)
-OR-
That their partner has to be over 6 feet in order to be a loving husband or father (which is not an earned attribute)
🚨Breaking News🚨 that stuff doesn’t speak to their character or values or morals as a human being, and who you should be sharing your life with.

These “standards” are many times the things that are keeping you back from meeting your relationship goals.

For more doses of reality, follow 
